              pathname === "/Official Document" ? (
                <NavDropdown
                  className="NavLi"
                  // onClick={() => promotion(1)}
                  style={{
                    marginLeft: 10,
                    color: "#808080",
                    fontSize: 20,
                    float: "left",
                    padding: 0,
                  }}
