                    <div className="icon_accounts">
                      <p className="textNavA">Services</p>
                    </div>
                  }
                >
                  <NavDropdown.Item>General Document</NavDropdown.Item>
                  <NavDropdown.Item>Official Document</NavDropdown.Item>
                </NavDropdown>
